import React, { useState, useEffect } from 'react';
import { makeStyles, withStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
    table: {
        width: '100%',
        height: '10px',
        overflowY: 'scroll',

    },
    container: {
        maxHeight: 230,
    },
});
const StyledTable = withStyles((theme) => ({
    root: {
        width: '95%',
        margin: 'auto',
        height: '100px',
        overflowY: 'scroll',
    },
}))(Table);

const StyledTableRow = withStyles((theme) => ({
    root: {
        backgroundColor: 'rgb(32,42,59)',

    },
}))(TableRow);

const StyledTabCell = withStyles((theme) => ({
    root: {
        borderColor: '#B6C512',
        color: 'white',

    },
    stickyHeader: {
        backgroundColor: 'rgb(32,42,59)',
    }
}))(TableCell);

const StyledTybody = withStyles((theme) => ({
    root: {
        height: '10px',
        overflowY: 'hidden',

    },
}))(TableBody);

/*------------------------- Data---------------------------------------- */
/* ---------------------------------------------------------------------- */
export default function CountrepartieTable({ data }) {
    const classes = useStyles();
    const [donnee, setData] = useState([]);
   
    const count = 0

    useEffect(() => {
        setData(data);
    }, data)
    return (
        <TableContainer className={classes.container}>
            <StyledTable stickyHeader size="small" aria-label="sticky table">
                <TableHead>
                    <StyledTableRow>
                        <StyledTabCell>Entreprise</StyledTabCell>
                        <StyledTabCell align="left">Exposition</StyledTabCell>
                        <StyledTabCell align="left">Secteur activit√©</StyledTabCell>
                    </StyledTableRow>
                </TableHead>
                <StyledTybody>
                        
                    {donnee.map((row) => (
                        <StyledTableRow key={row.key} >
                            <StyledTabCell component="th" scope="row">
                                {row.Entreprise}
                                
                            </StyledTabCell>
                            <StyledTabCell align="left">{row.Exposition}</StyledTabCell>
                            <StyledTabCell align="left">{row.Secteur}</StyledTabCell>

                        </StyledTableRow>

                    )


                    )}
                </StyledTybody>
            </StyledTable>
        </TableContainer>
    );
}
